export const ObjetosLiterales = () => {

    const persona = {
        nombre: 'Fernando',
        edad: 35,
        direccion: {
            pais: 'Colombia',
            casaNo: 615
        }
    }

    return (
        <div>
            Objetos Literales
            <br/>
            <code>
                <pre>
                { JSON.stringify(persona, null, 2) }
                </pre>
            </code>
        </div>
    )
}
